import styled from 'styled-components';

const ModalWrapper = styled.div`
  position: fixed;
  top: 0;
  bottom: 0;
  right: 0;
  left: 0;
  background: #00000096;
`;

const ModalBox = styled.div`
  background: #fff;
  border: 15px;
  width: 50%;
  height: 50%;
`;

export { ModalWrapper, ModalBox };
